export default function Count({by, TotalIncrement, TotalDecrement})
{

    function increment1()
    {
        TotalIncrement(by)
    }

    function decrement1()
    {
        TotalDecrement(by)
    }
    return(<div className="counter">
                <div>
                    <button className="decrement" onClick={decrement1}>-{by}</button>
                    <button className="increment" onClick={increment1}>+{by}</button>
                </div>
          </div>
    )

}
